VW Golf7 TSI/GTI(ハッチバック車)、Golf7 Variant TSIに適合するGolf7 GTI-Look フロントバンパーキット(LEDフォグランプ付)です。装着することでGolf7 TSI、Golf7 Variant TSIをGTIルックに変身させることが出来ます。<br><br>キット内容：フロントバンパー(ヘッドライトウォッシャーホール有、センサーホール無）、LEDフォグランプ(R/L)、フォグランプベース(R/L)、牽引フックカバー、フロントスポイラー(R/L)、ロアーグリルセンター、ロアースポイラー、ロアーサイドグリルインナー(R/L)、ロアーサイドグリルアウター(R/L)<br><br>※画像はイメージです。※フロントバンパー、サイドスカートは未塗装品※ロアーグリルセンターにカメラ部の穴は開いていません(要加工)※フロントグリルは別売<br><br>適合車種：VW Golf7 TSI/VW Golf7 Variant TSI<br><br><br><br>ボディパーツ | ボディパーツその他<BR>※こちらの商品は代引き不可です<tr><td colspan="2">
